  \"2016-05-27T02:32:53.523351\",\n\t\"name\": \"mobile-home-parks\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The most vulnerable residential population
  to hurricanes, tornadoes, flooding and other natural disasters are those that reside
  in Mobile Homes and Recreational Vehicle (RV) parks. According to the U.S. Census
  Bureau, 31% of the people killed in tornadoes between 2009 and 2011 were residing
  in or fleeing from mobile homes. An inventory of mobile home park locations and
  the number of mobile homes within those parks is, therefore, essential for emergency
  preparedness and evacuation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
